import styles from "../assets/NavBarMenu.module.css";
import { BrowserRouter as Router, Link } from "react-router-dom";

function NavBarMenu() {
  return (
    <div className={styles.navBarContainer}>
      <Router>
        <Link to="/home">
          <p>Home</p>
        </Link>
        <Link to="/shows">
          <p>Shows</p>
        </Link>
        <Link to="/contact">
          <p>Contact</p>
        </Link>
        <Link to="/about">
          <p>About</p>
        </Link>
      </Router>
    </div>
  );
}

export default NavBarMenu;
